def display_images_and_ground_truth(img_path):
    annot_path = img_path.replace(".png", ".txt")
    
    df = pd.read_csv(annot_path, sep = " ", names = ["class", "xc", "yc", "w", "h"])
    im = imread(img_path)
    h, w, _ = im.shape
    df["w"] = round_(df["w"]*w)
    df["h"] = round_(df["h"]*h)
    df["x"] = round_(df["xc"]*w - df["w"]/2)
    df["y"] = round_(df["yc"]*h - df["h"]/2)
    for index, row in df.iterrows():
        print(obj_names[int(row["class"])])
        rectangle(im, (int(row["x"]), int(row["y"])), (int(row["x"]) + int(row["w"]), int(row["y"]) + int(row["h"])), colors[int(row["class"])], 2)
        putText(im, obj_names[int(row["class"])], (int(row["x"])-4, int(row["y"])-4), FONT_HERSHEY_SIMPLEX, 1, colors[int(row["class"])], 1, LINE_AA)
    cv2_imshow(im)


